import axios from "axios";

function Api() {
    const API_BASE_URL = "http://localhost:8080/api";

    const api = axios.create({
        baseURL: API_BASE_URL,
        headers: {
            "Content-Type": "application/json",
        },
        // ..... other options
    });

}

export default Api;
